import React from 'react';
import './Header.css'

function Header() {
    return (
        <header className="header">
            <h1 className="header_title">NewsExplorer</h1>
            <div className="header__descriptions">
                <p className="header__main-page">Главная</p>
                <p className="header__auth">Авторизоваться</p>
            </div>

        </header>
    )
}

export default Header;
